import React from 'react';
import { useForm } from "react-hook-form";
import Cookies from 'js-cookie'
import { Redirect } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { useHistory } from 'react-router-dom';
import './Register.scss';

const Register = () => {
	const { register, handleSubmit, watch, errors } = useForm();
  	const onSubmit = data => console.log(data);

  	console.log(watch("example"));

  return (
   	  <form className="Register" onSubmit={handleSubmit(onSubmit)}>
    	<input name="username" type="text" defaultValue="username" ref={register({ required: true })} />
    	<input name="exampleRequired" type="email" defaultValue="username" ref={register({ required: true })} />
    	<input name="exampleRequired" type="password" ref={register({ required: true })} />
      	{errors.exampleRequired && <span>This field is required</span>}
      	<input type="submit" />
      </form>
  );
};

export default Register;
